import React from 'react';
import logo from './logo.svg';
import './App.css';
import Button from 'antd/lib/button';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import Login from './FrontEnd/Container/Login.js'
import Main from './FrontEnd/Container/Main.js'
function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to='./FrontEnd/Container/Main.js'>Login</Link>
            </li>
            <li>
              <Link to='./FrontEnd/Container/Main.js'>Main</Link>
            </li>

          </ul>
        </nav>

        <Route path='./FrontEnd/Container/Main.js' exact component={Login} />
        <Route path='./FrontEnd/Container/Main.js' exact component={Main} />
      </div>
    </Router>
  );
}

export default App;
